@verratti#10441 Dakle CTFS se generalno koristi za periodične signale konačne snage(beskonačne energije) primjerice sinus, CTFT koristimo za aperiodične beskonačne signale konačne energije(srednje snage = 0). E sad dolazimo do pitanja zašto ne bi mogli napraviti CTFT od kosinusa, što i ne možemo po definiciji pa ga onda restringiramo na nekom simetričnom intervalu i dobijemo formulu za CTFT kosinusa preko duljine te restrikcije. Tada sve više povećavamo duljinu tu restrickije(do punog kosinusa = beskonacno) i uočavamo da dobivamo dva diracova impulsa u frekvenciji kosinusa. Zgodno je što bi u CTFSu dobili dva kronikerova impulsa u n-u koji odgovara frekvenciji kosinusa, nadalje očitavanjem amplituda ona dva diraca bi dobili upravo amplitudu kronikera u CTFS-u. Tako smo generalizirali CTFT da radi za sve funkcije i pokazuje da postoji zapravo veza između CTFS i CTFT.

Dakle CTFT za periodične, CTFT za aperiodične, ali možemo ga uzeti i za periodične ako nam je to zgodno u tom trenutku jer želimo koristiti jednu transformaciju za sve signale.

